Array.prototype.isValueInFirstsNValues = function(value,nvalues) {
	if (!nvalues) nvalues=0;
	var l = this.length<nvalues?this.length:nvalues;
	for (var i=0; i<l; ++i) {
		if (value == this[i])
			return true;
	}
	return false;
}
var vvresu=[],  viiresu={};
function buscarraices() {
	for (ii=0; ii<ap.length; ++ii) {
//		if (viiresu[ii]) continue;
		
		for (var nj=7; nj<14; ++nj) {
			var vn = [], vb = [], vv=[];
			var nval = nj;


			for (var i=0; i<nj; ++i) {
				if (i%2==0)
					vb.push(ap[ii][i])
				else
					vn.push(ap[ii][i])
				vv.push(ap[ii][i]);
			}

			var ok=true;
			var key = vv.join(',');
			var vresu = [];

			for (var i=0; i<ap.length; ++i) {
				if (i==ii)
					continue;
				ok=true;
				for (var j=0; j<vn.length; ++j) {
					if (!ap[i].isValueInFirstsNValues(vn[j],nval)) {
						ok=false;
						break;
					}
				}
				if (ok) {
					for (var j=0; j<vb.length; ++j) {
						if (!ap[i].isValueInFirstsNValues(vb[j],nval)) {
							ok=false;
							break;
						}
					}
				}
				if (ok) {
					vresu.push(i);
					if (!vvresu[ii]) {
						vvresu[ii]=[];
					}
					if (!vvresu[ii][nj]) vvresu[ii][nj]=[]
					
					
					vvresu[ii][nj].push(i);

				}
			}  // loop ap
			if (vresu.length) {
				if (!viiresu[ii]) viiresu[ii]=[];
				if (!viiresu[ii]) {!viiresu[ii]=[]}
				viiresu[ii].push({
					jugadas: nj,
					length: vresu.length,
					indexs: Array.prototype.slice.call(vresu),
						'vb':vb.sgclone(),
						'vn':vn.sgclone(),
					'vv':'"'+vv.join(',')+'"',
					
					
				})
				
			}
			
		} // loop nj
			
	}
	// console.log(vresu.length);
	// console.log(vresu);
}

